import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

import ItemList from './Issues';


function App() {
    return (
        <Router>
            <nav>
                <Link to="/">Issues</Link>
            </nav>

            <Routes>
                <Route path="/" element={<ItemList/>}/>
            </Routes>
        </Router>
    )
}

export default App;
